public class Solution {
    public long MinimumCost(int[] nums, int k, int dist) {
        int n = nums.Length;
        long[,] dp = new long[k + 1, n + 1];
        for (int i = 0; i <= k; i++) {
            for (int j = 0; j <= n; j++) {
                dp[i, j] = long.MaxValue;
            }
        }
        dp[0, 0] = 0;

        for (int i = 1; i <= k; i++) {
            for (int j = i; j <= n; j++) {
                for (int m = 1; m <= dist + 1 && j - m >= i - 1; m++) {
                    if (dp[i - 1, j - m] != long.MaxValue) {
                        dp[i, j] = Math.Min(dp[i, j], dp[i - 1, j - m] + nums[j - m]);
                    }
                }
            }
        }

        long result = long.MaxValue;
        for (int i = n; i >= n - dist && i > 0; i--) {
            result = Math.Min(result, dp[k, i]);
        }

        return result;
    }
}
